import React, { startTransition, useEffect, useRef, useState } from "react";
import './Skill.css';
import car from '../../../asset/img/car.png'
import anime from "animejs";

const Skill = () => {
    const lineRef = useRef(null);
    const containerLine1 = useRef(null);
    const containerLine2 = useRef(null);
    const [progress, setProgress] = useState(0);
    const [spaceProgress, setSpaceProgress] = useState(0);
    const skills = [
        { title: "Frontend", skill: ["HTML", "CSS", "JavaScript", "React"] },
        { title: "Backend", skill: ["PHP", "Laravel", "Node.js"] },
        { title: "DevOps", skill: ["AWS", "Docker", "Git"] },
        { title: "Design", skill: ["Figma", "Photoshop"] },
        { title: "Testing", skill: ["Jest", "Cypress"] }
    ];
    // Inicializamos refs dinámicamente
    const skillRefs = useRef(skills.map(() => React.createRef()));
    const scrollableRef = useRef(null);

    useEffect(() => {
        if (scrollableRef.current) {
            scrollableRef.current.scrollTop = scrollableRef.current.scrollHeight;
        }



        const handleScroll = () => {
            if (scrollableRef.current) {
                const scrollTop = scrollableRef.current.scrollTop; // Current scroll position
                const scrollHeight = scrollableRef.current.scrollHeight; // Full content height
                const clientHeight = scrollableRef.current.clientHeight; // Visible height

                const maxScroll = scrollHeight - clientHeight; // The total scrollable distance

                if (maxScroll > 0) {
                    const progressPercent = Math.min((maxScroll - scrollTop) / maxScroll * 100, 100);
                    setProgress(progressPercent); // Progress in percentage

                    // Show skills as scroll progresses
                    skillRefs.current.forEach((ref, index) => {
                        const threshold = ((skills.length) - index) * (100 / skills.length - 5);
                        if (progressPercent > threshold && ref.current) {
                            ref.current.classList.add('active');
                        } else if (progressPercent < threshold && ref.current) {
                            ref.current.classList.remove('active');
                        }
                    });

                    // Adjust the progress line height
                    if (lineRef.current) {
                        const lineHeight = Math.min(progressPercent * 1, 300);
                        // lineRef.current.style.height = `100%`;
                    }

                }
            }
        };


        const handleWheel = (event) => {
            if (scrollableRef.current && scrollableRef.current.contains(event.target)) {
                event.preventDefault(); // Prevent body scroll
                scrollableRef.current.scrollBy({
                    top: event.deltaY,
                    behavior: 'smooth'
                });
                handleScroll();
            }
        };

        // Attach event listeners for scroll and wheel
        document.addEventListener('wheel', handleWheel, { passive: false });
        if (scrollableRef.current) {
            scrollableRef.current.addEventListener('scroll', handleScroll);
        }

        // Cleanup listeners when the component unmounts
        return () => {
            document.removeEventListener('wheel', handleWheel);
            if (scrollableRef.current) {
                scrollableRef.current.removeEventListener('scroll', handleScroll);
            }
        };
    }, []);


    const animation = () => {
        // Obtener elementos y sus translateY iniciales
        const elementOne = document.querySelector('.container-line-one');
        const elementTwo = document.querySelector('.container-line-two');
        const elementThree = document.querySelector('.container-line-three');

        // Función para iniciar la animación de un bloque
        const startAnimation = (element, nextElement) => {
            const style = window.getComputedStyle(element);
            const matrix = new WebKitCSSMatrix(style.transform);
            const translateY = matrix.m42;
            anime({
                targets: element,
                translateY: [translateY, 1010],
                easing: 'linear',
                duration: 10000,
                complete: () => {
                    // Al finalizar, establece translateY a -1000
                    element.style.transform = 'translateY(-1010px)';
                }
            });

            // Comprobar el translateY del bloque actual
            const checkTranslateY = setInterval(() => {
                const style = window.getComputedStyle(element);
                const matrix = new WebKitCSSMatrix(style.transform);
                const translateY = matrix.m42;

                // Si translateY es mayor a 0, iniciar la animación del siguiente bloque
                if (translateY > 0) {
                    clearInterval(checkTranslateY);
                    if (nextElement) {
                        startAnimation(nextElement, nextElement === elementThree ? null : elementThree); // Llama al siguiente bloque
                    } else {
                        // Reiniciar la animación cuando el último bloque complete
                        startAnimation(elementOne, elementTwo);
                    }
                }
            }, 100);
        };

        // Iniciar la animación desde el primer bloque y pasar el segundo bloque
        startAnimation(elementOne, elementTwo);
    };






    return (
        <div className="skills-container-a" ref={scrollableRef}>


            <div className="skills-container">
                <img className="car" onClick={() => animation()} src={car} />
                <div className="progress-line">
                    <div className="container-line-three" ref={containerLine1}>
                        <div className="line" ></div>
                        <div className="line" ></div>
                        <div className="line" ></div>
                        <div className="line" ></div>
                        <div className="line" ></div>
                        <div className="line" ></div>
                        <div className="line" ></div>
                    </div>
                    <div className="container-line-two" ref={containerLine2}>
                        <div className="line" ></div>
                        <div className="line" ></div>
                        <div className="line"  ></div>
                        <div className="line"  ></div>
                        <div className="line"  ></div>
                        <div className="line"  ></div>
                        <div className="line"  ></div>
                    </div>
                    <div className="container-line-one" ref={containerLine2}>
                        <div className="line"  ></div>
                        <div className="line"  ></div>
                        <div className="line"  ></div>
                        <div className="line"  ></div>
                        <div className="line"  ></div>
                        <div className="line"  ></div>
                        <div className="line"  ></div>
                    </div>
                    {
                        skills.map((skill, index) => {
                            const positionStyle = {
                                top: `${(index * (100 / (skills.length)))}%`, // Calcula la posición vertical
                            };


                            return (

                                <div className="dot" style={positionStyle} key={index}></div>


                            );
                        })}
                </div>
                <div className="skills">
                    {skills.map((skill, index) => {
                        return (
                            <div className="skill" key={index} ref={skillRefs.current[index]}>
                                <h3>{skill.title}</h3>
                                <p>{skill.skill.join(', ')}</p>
                            </div>
                        );
                    })}
                </div>

            </div>


            <div className="bulto"></div>
        </div>
    );
}

export default Skill;
